using namespace std;

class Solution {
public:
    int countCornerRectangles(vector<vector<int>>& grid)
    {
        if(grid.size() == 0 || grid.size() == 1)
        {
            return 0;
        }

        if(grid[0].size() == 0 || grid[0].size() == 1)
        {
            return 0;
        }

        int m = grid.size();
        int n = grid[0].size();

        int res = 0;

        std::map<int, std::set<int>> map;
        for(int i = 0; i < m; ++i)
        {
            for(int j = 0; j < n; ++j)
            {
                if(grid[i][j])
                {
                    map[i].insert(j);
                }
            }
        }

        for(auto i = map.begin(); i != map.end(); ++i)
        {
            int startX = i->first;
            for(auto startY : i->second)
            {
                auto j = i;
                ++j;
                for(;j != map.end(); ++j)
                {
                    int endX = i->first;
                    if(j->second.find(startY) == j->second.end())
                    {
                        continue;
                    }

                    for(auto k = j->second.upper_bound(startY); k != j->second.end(); ++k)
                    {
                        if(grid[startX][*k])
                        {
                            ++res;
                        }
                    }
                }
            }
        }

        return res;
    }
};

